import React from 'react'

 const Balance = ({date,month,year,bal}) => {
    return (
        <div className="balance">
                <div>         
                <p>{date}/{month}/{year}</p>
                 <p>Final Balance</p>
                </div>
                 <div> <span>{bal}</span>
                     </div>
                 
             
        </div>
    )
}
export default Balance;
